using System;
using System.Text;
using System.Threading.Tasks;

namespace AoC._5
{
	class Program
	{
		private static readonly string Sequence =
			@"";

		private static string DeriveSequence(string sequenceStr)
		{
			var sequence = new StringBuilder(sequenceStr);

			bool changed;
			do
			{
				changed = false;
				for (var i = 0; i < sequence.Length - 1; ++i)
				{
					if (string.Equals(sequence[i].ToString(), sequence[i + 1].ToString(), StringComparison.InvariantCultureIgnoreCase)
						&& (char.IsUpper(sequence[i]) && char.IsLower(sequence[i + 1]) ||
							char.IsLower(sequence[i]) && char.IsUpper(sequence[i + 1])))
					{
						sequence[i] = '-';
						sequence[i + 1] = '-';
						changed = true;
					}
				}

				sequence.Replace("-", "");
			} while (changed);

			return sequence.ToString();
		}

		static void Main()
		{
			Console.WriteLine("Advent of Code Day 5!");

			Console.WriteLine($"Initial length: {Sequence.Length}");

			Console.WriteLine($"First Star: {DeriveSequence(Sequence).Length}");

			Task.Run(() => Console.WriteLine($"Second Star (a/A): {DeriveSequence(Sequence.Replace("a", "", StringComparison.InvariantCultureIgnoreCase)).Length}"));
			Task.Run(() => Console.WriteLine($"Second Star (b/B): {DeriveSequence(Sequence.Replace("b", "", StringComparison.InvariantCultureIgnoreCase)).Length}"));
			Task.Run(() => Console.WriteLine($"Second Star (c/C)*: {DeriveSequence(Sequence.Replace("c", "", StringComparison.InvariantCultureIgnoreCase)).Length}"));
			Task.Run(() => Console.WriteLine($"Second Star (d/D): {DeriveSequence(Sequence.Replace("d", "", StringComparison.InvariantCultureIgnoreCase)).Length}"));

			Console.ReadLine();
		}
	}
}